<!DOCTYPE html>
<html lang="">
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width,initial-scale=1.0" />
    <link rel="icon" href="<%= BASE_URL %>favicon.ico" />
    <title><%= htmlWebpackPlugin.options.title %></title>
    <link href="<%= BASE_URL %>static/css/bootstrap.min.css" rel="stylesheet" />
    <link
      href="<%= BASE_URL %>static/css/font-awesome.min.css"
      rel="stylesheet"
    />
    <link href="<%= BASE_URL %>static/css/style.css" rel="stylesheet" />
    <link
      href="<%= BASE_URL %>static/css/default-animation.css"
      rel="stylesheet"
    />
    <link
      href="<%= BASE_URL %>static/fonts/flaticon/flaticon.css"
      rel="stylesheet"
    />
    <link href="<%= BASE_URL %>static/css/range-slider.css" rel="stylesheet" />
    <link href="<%= BASE_URL %>static/css/color.css" rel="stylesheet" />
    <link href="<%= BASE_URL %>static/css/responsive.css" rel="stylesheet" />
    <link href="<%= BASE_URL %>static/css/loader.css" rel="stylesheet" />
  </head>
  <body>
    <noscript>
      <strong
        >We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work
        properly without JavaScript enabled. Please enable it to
        continue.</strong
      >
    </noscript>
    <div id="app"></div>
    <!-- built files will be auto injected -->
    <script src="<%= BASE_URL %>static/js/jquery.min.js"></script>
    <script src="<%= BASE_URL %>static/js/bootstrap.min.js"></script>
    <script src="<%= BASE_URL %>static/js/YouTubePopUp.jquery.js"></script>
    <script src="<%= BASE_URL %>static/js/jquery.fancybox.pack.js"></script>
    <script src="<%= BASE_URL %>static/js/jquery.fancybox-media.js"></script>
    <script src="<%= BASE_URL %>static/js/owl.js"></script>
    <script src="<%= BASE_URL %>static/js/mixitup.js"></script>
    <script src="<%= BASE_URL %>static/js/validate.js"></script>
    <script src="<%= BASE_URL %>static/js/wow.js"></script>
    <script src="<%= BASE_URL %>static/js/custom.js"></script>
    <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyBPZ-Erd-14Vf2AoPW2Pzlxssf6-2R3PPs&callback=initMap"></script>
    <script src="<%= BASE_URL %>/static/js/map.scripts.js"></script>
  </body>
</html>
